import React from 'react';


class App extends React.Component {
	constructor() {
		super()
		this.state = {
			search: ""
		}
	}

	render() {
		return (
			<div>
				<input
					type="text"
					value="">
				</input>
			</div>
		);
	}
}

export default App;
